import React from 'react';
import Layout from '../components/Layout/Layout';

const Academics= () => {
    return (
        <Layout>
            <div className="academics">
                <h1>Academics</h1>
                <p>Welcome to the Academics page of our school. Here you will find information about our academic programs, curriculum, and faculty.</p>

                <h2>Academic Programs</h2>
                <ul>
                    <li>Program 1: Description</li>
                    <li>Program 2: Description</li>
                    <li>Program 3: Description</li>
                </ul>

                <h2>Curriculum</h2>
                <p>Our curriculum is designed to provide a comprehensive education that prepares students for future success.</p>

                <h2>Faculty</h2>
                <p>Meet our dedicated faculty members who are committed to providing quality education.</p>
            </div>
        </Layout>
    );
};

export default Academics;
